import React from 'react';
import { HStack, Button } from '@chakra-ui/react'
import { useNavigate } from 'react-router-dom';


function TextChat() {

    let navigate = useNavigate();
    const redirectDataAnalytics = () => {
        return navigate("/data-analytics")
    }
    const redirectTextChat = () => {
        return navigate("/text-chat")
    }

    return (
        <div className="App">
            <header>
                <HStack justify="center">
                    <Button onClick={redirectDataAnalytics}>Data Analytics</Button>
                    <Button onClick={redirectTextChat}>Text Chat</Button>
                </HStack>
            </header>
            <section class="create-chat">
                <div class="content">
                    <form id="createChatForm">
                        <label for="employees">Select employees:</label>
                        <div class="form-content">
                            <select id="employees" class="select2" multiple>
                                // Add your employee options here
                                <option value="employee1">Employee 1</option>
                                <option value="employee2">Employee 2</option>
                                <option value="employee3">Employee 3</option>
                            </select>
                        </div>
                        <button type="submit">Create Chat</button>
                    </form>
                </div>
            </section>
            <section class="chat-list">
                <div class="content">
                    <h2>Existing chats:</h2>
                    <ul id="chatList">
                    </ul>
                </div>
            </section>
            <script src="chat_create.js"></script>
        </div>
    );
}

export default TextChat;
